#include <stdio.h>

void bubble(int lista[], int tam){
    for (int i = tam; i > 0; i--){
        for (int j = 1; j < i; j++){
            if (lista[j - 1] > lista[j]) {
                int temp = lista[j];
                lista[j] = lista[j - 1];
                lista[j - 1] = temp;
            }
        }
    }
}

